import React, { useState } from "react";
import Header from "../components/Header";
import Sidebar from "../components/Sidebar";
import Footer from "../components/Footer";

function TextSummarizer() {
  const [isSidebarOpen, setIsSidebarOpen] = useState(false); // Estado para la barra lateral
  const [uploadedText, setUploadedText] = useState(""); // Texto cargado del archivo
  const [summary, setSummary] = useState(""); // Resultado del resumen
  const [processing, setProcessing] = useState(false); // Estado de procesamiento
  const [selectedTechnique, setSelectedTechnique] = useState(""); // Técnica seleccionada

  const toggleSidebar = () => {
    setIsSidebarOpen((prev) => !prev);
  };

  const handleFileUpload = (event) => {
    const file = event.target.files[0];
    if (file) {
      const reader = new FileReader();
      reader.onload = (e) => {
        setUploadedText(e.target.result);
      };
      reader.readAsText(file);
    }
  };

  const handleSummarize = () => {
    if (!uploadedText) {
      alert("Primero sube un archivo de texto.");
      return;
    }

    if (!selectedTechnique) {
      alert("Selecciona una técnica para el resumen.");
      return;
    }

    setProcessing(true);
    // Simular llamada al backend para resumen
    setTimeout(() => {
      setSummary(`Resumen generado usando la técnica: ${selectedTechnique}`);
      setProcessing(false);
    }, 2000); // Simulación de tiempo de procesamiento
  };

  return (
    <div className="bg-white min-h-screen flex flex-col relative">
      {/* Header */}
      <Header />

      {/* Sidebar */}
      <Sidebar isOpen={isSidebarOpen} toggleSidebar={toggleSidebar} />

      {/* Contenido principal */}
      <main className="flex-1 flex flex-row gap-8 p-6">
        {/* Sección izquierda */}
        <div className="flex flex-col gap-4 w-1/4">
          {/* Cuadro para cargar archivo */}
          <div className="bg-gray-100 p-4 rounded-lg shadow-lg">
            <h3 className="text-blue-800 font-bold text-center mb-4">Cargar archivo</h3>
            <input
              type="file"
              accept=".txt"
              onChange={handleFileUpload}
              className="block w-full border border-gray-300 rounded-lg p-2"
            />
          </div>

          {/* Barra desplegable para seleccionar técnica */}
          <div className="bg-gray-100 p-4 rounded-lg shadow-lg">
            <h3 className="text-blue-800 font-bold text-center mb-4">Seleccionar técnica</h3>
            <select
              value={selectedTechnique}
              onChange={(e) => setSelectedTechnique(e.target.value)}
              className="block w-full border border-gray-300 rounded-lg p-2"
            >
              <option value="">-- Selecciona una técnica --</option>
              {["Técnica 1", "Técnica 2", "Técnica 3", "Técnica 4", "Técnica 5", "Técnica 6"].map((technique) => (
                <option key={technique} value={technique}>
                  {technique}
                </option>
              ))}
            </select>
          </div>

          {/* Botón para procesar */}
          <button
            onClick={handleSummarize}
            className="py-2 px-4 rounded-md bg-blue-600 text-white font-semibold hover:bg-blue-700 transition"
            disabled={processing}
          >
            {processing ? "Procesando..." : "Generar Resumen"}
          </button>
        </div>

        {/* Sección derecha */}
        <div className="flex flex-col gap-4 w-3/4">
          <div className="flex flex-row gap-4">
            {/* Texto original */}
            <div className="bg-gray-100 p-6 rounded-lg shadow-lg w-1/2">
              <h3 className="text-blue-800 font-bold text-center mb-4">Texto original</h3>
              <pre className="whitespace-pre-wrap text-sm text-gray-800">{uploadedText || "El texto cargado aparecerá aquí."}</pre>
            </div>

            {/* Texto resumido */}
            <div className="bg-gray-100 p-6 rounded-lg shadow-lg w-1/2">
              <h3 className="text-blue-800 font-bold text-center mb-4">Texto resumido</h3>
              <pre className="whitespace-pre-wrap text-sm text-gray-800">{summary || "El resumen aparecerá aquí."}</pre>
            </div>
          </div>
        </div>
      </main>

      {/* Footer */}
      <Footer />
    </div>
  );
}

export default TextSummarizer;
